function regenerateThumbs(e){$.ajax({url:"/actions/regenerate_thumbs.php",type:"post",data:{videoid:e,origin:"upload_thumb"},dataType:"json",beforeSend:function(){showSpinner()},success:function(e){$("#thumb_list").html(e.template),$(".page-content").prepend(e.msg),hideSpinner()}})}function delete_thumb(e,t){$.ajax({url:"/actions/delete_thumbs.php",type:"post",dataType:"json",data:{videoid:e,num:t}}).done(function(e){$("#thumb_list").html(e.template)}).always(function(e){$(".page-content").prepend(e.msg)})}